import styled from 'styled-components/native';
import theme from '../../styles/theme';

export const ButtonApp = styled.TouchableOpacity`
  width: 80%;
  height: 40px;
  border-radius: 8px;
  background-color: #007b00;
  justify-content: center;
  align-items: center;
  border-width: 1px;
  border-color: #007b00;
  margin-bottom: 10px;
`;

export const Title = styled.Text`
    color: #fff;
    fontSize: 16,
`
